import './Home.css';
import { useEffect, useState, forwardRef, useImperativeHandle } from "react";
import Button from '@mui/material//Button';
import Landing from './Landing.js';
import Table from './Table.js';
import { BrowserRouter, Route, Routes } from 'react-router-dom'

function Home({ onLogout }) {
    const [token, setToken] = useState("")
    const [url, setURL] = useState("")
    const logout = () => {
        setToken("")
        window.localStorage.removeItem("token")
        window.location.reload();
    }
    return (
        <div className='Home'>
            <link rel="stylesheet" href="https://use.typekit.net/lll4eml.css"></link>
            <BrowserRouter>

                <div className='navBar'>
                    <p className='navBarItem'>TrackTheSpot</p>
                    <p className='navBarItem'>
                        <Routes>
                            <Route path=''><p className='navBarItemMenu'>Home</p></Route>
                            <Route path='/about'><p className='navBarItemMenu'>About</p></Route>
                        </Routes>
                        <div onClick={logout}><p className='navBarItemMenu'>Logout</p></div>

                    </p>
                </div>

            </BrowserRouter>
        </div>
    );
}

export default Home;
